import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <div>
            <nav>
                <ul>
                    <li>
                        <Link to='/'></Link>
                        <a className='nav-link' href='./'>Home</a>
                    </li>
                    <li>
                        <a className='nav-link' href='./subject'>Onderwerpen</a>
                    </li>
                    <li>
                        <a className='nav-link' href='./about'>Over</a>
                    </li>
                    <li>
                        <a className='nav-link' href='./login'>Login</a>
                    </li>
                    <li>
                        <a className='nav-link' href='./register'>Registreer</a>
                    </li>
                </ul>
            </nav>
        </div>
    );

};

// Log in pagina, bevat een titel, invultekst voor gebruikersnaam en wachtwoord en een link om te registreren

export default Navbar;
